import Login from '../src/component/Form';


function Router(){

  return(
    <BrowserRouter>
    <Switch>
    <Route path='/' element={<Login/>}/>

    </Switch>


    </BrowserRouter>
  )
}



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
